const initialState = {
  companies: []
}


export default function(state = initialState, action) {
  switch (action.type) {
    case 'FETCH_COMPANIES': {
      console.log('dfsfsf: ', state);
      return {
        ...state,
        companies: action.payload.companies
      };
    }
    default:
      return state;
  }
}
